INSERT INTO `pages` (`id`, `title`, `text`, `meta_title`, `meta_key`, `meta_desc`, `path`, `parent_id`, `lft`, `rgt`, `depth`, `created_at`, `updated_at`) VALUES
(1, 'О Магазине', 'Магазин доступной экзотики Karibuni предлагает яркие вещи для ярких людей! \r\n\r\nНаши аксессуары, одежда и обувь, сувениры и украшения из дерева, \r\nслоновой кости и банановых листьев сделают Вашу жизнь ярче и радостнее.\r\n\r\nНам удается находить необычные вещи из натуральных материалов \r\nв экологически чистых районах Африки, Индии и Азии \r\nи делать покупки в нашем магазине доступными для любого покупателя.\r\n\r\nДобро пожаловать всем - так переводится Karibuni с языка суахили.\r\n<br>\r\n<br>\r\nРадуйтесь вместе с нами!\r\n<br>\r\n<br>\r\nВаш Karibuni.\r\n<br>\r\n<br>\r\nИП Левунова В.Ю.\r\n<br>\r\n<br>\r\nОГРНИП: 313500115600014\r\n', '', '', '', 'about', NULL, 1, 2, 0, '2014-04-01 16:00:48', '2014-04-29 05:36:24'),
(2, 'Доставка', 'Курьерская доставка по Москве осуществляется бесплатно.\r\n<br>\r\n\r\n<br>\r\nПо Московской области мы доставляем товар по цене 250 руб.\r\nПри заказе от 5000 руб. доставка по Московской области осуществляется бесплатно.\r\n\r\n<br>\r\n<br>\r\nМы доставляем товары по будням с 12.00 до 20.00\r\nна следующий рабочий день после Вашего заказа. \r\n\r\n<br>\r\n<br>\r\nДоставку в выходной день и почтовую доставку в регионы\r\nВы можете индивидуально согласовать с менеджером магазина по телефону.', '', '', '', 'nadezhnaja-dostavka', NULL, 3, 4, 0, '2014-04-01 16:01:47', '2014-04-01 16:01:47'),
(3, 'Помощь', 'Подтверждение о получении заказа Вы получите по электронной почте.\r\n<br><br>\r\nПосле получения заказа наш оператор свяжется с Вами в течение нескольких часов по телефону для обсуждения деталей доставки.\r\n<br><br>\r\nЕжедневно с 10.00 до 22.00 Вы можете связаться по телефону с работниками магазина по любым вопросам и для уточнения информации о доставке.\r\n<br><br>\r\nВ случае временного отсутствия товара на складе Вы можете сделать бесплатный заказ по телефону - +7 985 489 40 88 или электронной почте - support@karibuni.ru.', '', '', '', 'help', NULL, 5, 6, 0, '2014-04-01 16:02:31', '2014-04-01 16:02:31'),
(4, 'Контакты', '<h3>+7 (985) 489-40-88</h3>\r\n<h3>support@karibuni.ru</h3>\r\n', '', '', '', 'contacts', NULL, 7, 8, 0, '2014-04-01 16:03:08', '2014-04-01 16:04:03');
